import React, { Component } from 'react'
import './Selector.css'

export default class Selector extends Component {
    constructor(props){
        super()
    }
    render() {

        return (
            <div className="selector">
                <div>{this.props.username}</div>
                <ul>
                    <li>Your pets</li>
                    {this.props.pets.map((pet,index) => <li onClick={(index) => this.props.select(this.props.pets[index])} className="pet">{pet.name}</li>)}
                </ul>

            </div>
        )
    }
}
